import React from 'react';
import {BrowserRouter, Route, Switch } from 'react-router-dom';



const App = () => {
    return (
        <div className="ui container">
            <Router history = {history}>
                <div>
                <Header />
                <Switch>
                    <Route path="/" exact component={ScopeList} />
                    <Route path="/streams/new" exact component={ScopeCreate} />
                    <Route path="/streams/edit/:id" exact component={ScopeEdit} />
                    <Route path="/streams/delete/:id" exact component={ScopeDelete} />
                    <Route path="/streams/:id" exact component={ScopeShow} />
                    </Switch>
                </div>
            </Router>
        </div>
    )}

export default App;
